    pass += str.charAt(char);
  }
  return pass;
};

const validateEmail = (email: string) => {
  return (
    email.length &&
    email
      .toString()
      .toLowerCase()
      .match(
        /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|.(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/
      )
  );
};

const validatePhone = (number: string) => {
  const regex = /^\+\d{1,3}-\d{3}-\d{3}-\d{4}$/;
  return regex.test(number);
};
